import axios from "axios";
import { useEffect, useState } from "react";
//import MovieList from "./MovieList";
import Movie from "./Movie";
function FavList() {
    const [moviesData, setMoviesData] = useState([]);
    const sendReq = async () => {
        const serverUrl = `https://onlineserver-w9zu.onrender.com/getMovies`;
        const result = await axios.get(serverUrl);
        console.log(result.data);
        setMoviesData(result.data);

    }
    const takeNewArr = (newarr) => {
        setMoviesData(newarr)
    }
    useEffect(() => {
        sendReq();
    },[]);
    return (
        <>
            <h1>Fav List</h1>
            <Movie favData={moviesData} takeNewArr={takeNewArr}  takeNewArrDetele={takeNewArr}/>

        </>
    )
}
export default FavList;
